INSERT INTO `PRODUCT` (NAME,PRICE,DESCRIPTION,IMG,CATEGORY_ID,IMG_SRC) VALUES ('The Terminator (1984)',129.00,'A Cyborg has been sent from the future on a deadly mission, it has been programmed to kill a young woman named Sarah Connor. Sarah has no idea that her life will have a staggering effect on the fate of mankind and that she is in danger of being killed at the hands of an inescapable machine known as the Terminator. Kyle Reese has also been sent from the future, but his mission is to protect the unknowing mother of a future leader. Is there any way to stop the death of an innocent when the relentless Cyborg is set on his course...','the_terminator.jpg',1, X'');
INSERT INTO `PRODUCT` (NAME,PRICE,DESCRIPTION,IMG,CATEGORY_ID,IMG_SRC) VALUES ('Seven Samurai (1956)',129.00,'Akira Kurosawas epic tale concerns honor and duty during a time when the old traditional order is breaking down. The film opens with master samurai Kambei (Takashi Shimura) posing as a monk to save a kidnapped farmers child. Impressed by his selflessness and bravery, a group of farmers begs him to defend their terrorized village from bandits. Kambei agrees, although there is no material gain or honor to be had in the endeavor. Soon he attracts a pair of followers: a young samurai named Katsushiro (Isao Kimura), who quickly becomes Kambeis disciple, and boisterous Kikuchiyo (Toshiro Mifune), who poses as a samurai but is later revealed to be the son of a farmer. Kambei assembles four other samurais, including Kyuzo (Seiji Miyaguchi), a master swordsman, to round out the group. Together they consolidate the villages defenses and shape the villagers into a militia, while the bandits loom menacingly nearby. Soon raids and counter-raids build to a final bloody heart-wrenching battle.','seven_samurai.jpg',1, X'' );
INSERT INTO `PRODUCT` (NAME,PRICE,DESCRIPTION,IMG,CATEGORY_ID,IMG_SRC) VALUES ('The Cabinet of Dr.Caligari (1920)',129.00,'Werner Krauss plays the title character, a sinister hypnotist who travels the carnival circuit displaying a somnambulist named Cesare (Conrad Veidt). In one tiny German town, a series of murders coincides with Caligaris visit. When the best friend of hero Francis (Friedrich Feher) is killed, the deed seems to be the outgrowth of a romantic rivalry over the hand of the lovely Jane (Lil Dagover). Francis suspects Caligari, but he is ignored by the police. Investigating on his own, Francis seemingly discovers that Caligari has been ordering the somnambulist to commit the murders, but the story eventually takes a more surprising direction.','dr_caligari.jpg',2, X'');
INSERT INTO `PRODUCT` (NAME,PRICE,DESCRIPTION,IMG,CATEGORY_ID,IMG_SRC) VALUES ('Psycho (1960)',129.00,'From its first scene, in which an unmarried couple balances pleasure and guilt in a lunchtime liaison in a cheap hotel (hardly a common moment in a major studio film in 1960), Psycho announced that it was taking the audience to places it had never been before, and on that score what followed would hardly disappoint. Marion Crane (Janet Leigh) is unhappy in her job at a Phoenix, Arizona real estate office and frustrated in her romance with hardware store manager Sam Loomis (John Gavin). One afternoon, Marion is given $40,000 in cash to be deposited in the bank. Minutes later, impulse has taken over and Marion takes off with the cash, hoping to leave Phoenix for good and start a new life with her purloined nest egg. 36 hours later, paranoia and exhaustion have started to set in, and Marion decides to stop for the night at the Bates Motel, where nervous but personable innkeeper Norman Bates (Anthony Perkins) cheerfully mentions that shes the first guest in weeks, before he regales her with curious stories about his mother. Theres hardly a film fan alive who doesnt know what happens next, but while the shower scene is justifiably the films most famous sequence, there are dozens of memorable bits throughout this film.','psycho.jpg',2, X'');
INSERT INTO `PRODUCT` (NAME,PRICE,DESCRIPTION,IMG,CATEGORY_ID,IMG_SRC) VALUES ('Casablanca (1942)',129.00,' Simply put, it is the story of Rick Blaine (Humphrey Bogart), a world-weary ex-freedom fighter who runs a nightclub in Casablanca during the early part of WWII. Despite pressure from the local authorities, notably the crafty Capt. Renault (Claude Rains), Ricks café (C) has become a haven for refugees looking to purchase illicit letters of transit which will allow them to escape to America. One day, to Ricks great surprise, he is approached by the famed rebel Victor Laszlo (Paul Henreid) and his wife, Ilsa (Ingrid Bergman), Ricks true love who deserted him when the Nazis invaded Paris. She still wants Victor to escape to America, but now that shes renewed her love for Rick, she wants to stay behind in Casablanca. "You must do the thinking for both of us," she says to Rick. He does, and his plan brings the story to its satisfyingly logical, if not entirely happy, conclusion.','casablanca.jpg',3, X'');
INSERT INTO `PRODUCT` (NAME,PRICE,DESCRIPTION,IMG,CATEGORY_ID,IMG_SRC) VALUES ('The Philadelphia Story (1940)',129.00,'Set among the upper class in 1930s Philadelphia, this irreverent classic romantic comedy features radiant performances by three legendary stars. On the eve of her marriage to an uninteresting man, a headstrong socialite jousts verbally with her charming ex-husband, drinks too much champagne, and flirts outrageously with a handsome reporter.','the_phaldelphia_story.jpg',3, X'');
INSERT INTO `PRODUCT` (NAME,PRICE,DESCRIPTION,IMG,CATEGORY_ID,IMG_SRC) VALUES ('Modern Times',129.00,'This episodic satire of the Machine Age is considered Charles Chaplins last "silent" film, although Chaplin uses sound, vocal, and musical effects throughout. Chaplin stars as an assembly-line worker driven insane by the monotony of his job. After a long spell in an asylum, he searches for work, only to be mistakenly arrested as a Red agitator. Released after foiling a prison break, Chaplin makes the acquaintance of orphaned gamine (Paulette Goddard) and becomes her friend and protector. He takes on several new jobs for her benefit, but every job ends with a quick dismissal and yet another jail term. ','modern_times.jpg',4, X'');
INSERT INTO `PRODUCT` (NAME,PRICE,DESCRIPTION,IMG,CATEGORY_ID,IMG_SRC) VALUES ('The Odd Couple',129.00,'In this film, compulsive neatnik Felix Unger is thrown out of his house by his wife. He gravitates to the apartment of his best friend, incorrigibly-sloppy sportswriter Oscar Madison. Oscar invites Felix to move in with him, but within days the mismatched pair is on the verge of mutual murder.','the_odd_couple.jpg',4, X'');
